import React, { Fragment } from 'react';
import Formulario from './Components/Formulario';

function App() {
  return (
    <Fragment>
      <h1><u>ADMINISTRACION DE PACIENTES</u></h1>
      <div className="container">
        <div className="row">
          <div className="one-half colum">
            <Formulario />
          </div>
          <div className="eleven-half colum">
          <Formulario />
          </div>     
        </div>
      </div>
    </Fragment>
  );
}

export default App;
